import Vue from "vue";
import VueObservable from "vue-observable";

Vue.use(VueObservable);

const datas = Vue.observable({
  appName: "Melhor Frete",
  city: null,
  weight: null,
  showOutput: false,
  frete: {
    menorValor: {
      transportadora: "",
      tempo: "",
      preco: "",
    },
    maisRapido: {
      transportadora: "",
      tempo: "",
      preco: "",
    },
  },
  citys: [
    // lista de cidades
  ],
});

export default {
  datas,
  ...mutations,
};
